import React, {Component, useState, useEffect} from "react";
import service from "../services/service";
import {FormControl, NativeSelect, Select} from "@material-ui/core";
import {makeStyles} from "@material-ui/core";

const useStyles = makeStyles( theme => ({
    formControl:{
        margin: theme.spacing(1),
        minWidth: 120,
    },
    selectEmpty:{
        marginTop: theme.spacing(2),
    }
}));


class FilterbarComponent extends Component{

    constructor(props) {
        super(props);
        this.state = {
            brandoptions : [],
            selectedOption: null,
        }
    }
    componentDidMount() {
        console.log("FilterbarComponent componentDidmount fired");
        service.getBrands().then( (res) =>{
            console.log("FilterbarComponent, :", res);
            this.setState({brandoptions: res.data});
        });
    };
    // handleChange: (option: any): void =>{
    //     this.setState({
    //     selectedOption: option,});
    // };

    render() {
        console.log("FilterbarComponent render: ", this.state.brandoptions);
        return(
            <div className="container">
                <FormControl>
                    <NativeSelect options={this.state.brandoptions}>

                    </NativeSelect>
                    <Select className="category">
                    </Select>
                </FormControl>
            </div>
        );
    }
}
export default FilterbarComponent
